import styled from "styled-components";
import { motion } from "framer-motion";

const BoostComponentStyle = styled(motion.div)`
  position: relative;
  height: auto;
  width: 90vw;
  left: 5vw;
  display: flex;
  flex-direction: column;
  .title {
    font-size: 100px;
    color: #f8f8ff;
  }
`;

const BoostComponent = () => {
  return (
    <BoostComponentStyle>
      <span className="title"> boosting to the moon </span>
      <div className="details">
        <div className="stat">
          <span className="number">+10 million</span>
          <span className="text">
            Articles have been public around the world (as of Sept. 30, 2021)
          </span>
        </div>
        <div className="stat">
          <span className="number">+100 million</span>
          <span className="text">
            Registered users account (as of Sept. 30, 2021)
          </span>
        </div>
        <div className="stat">
          <span className="number">+180</span>
          <span className="text">
            Articles have been public around the world (as of Sept. 30, 2021)
          </span>
        </div>
      </div>
    </BoostComponentStyle>
  );
};
export default BoostComponent;
